solution:
Drawing a figure allows us to see that $3=AF=\frac{AE}{2}=\frac{AD}{4}=\frac{AC}{8}=\frac{AB}{16}\implies AB=\boxed{48}$.

[asy]
pair A,B,C,D,E,F;

A = (0,0);
B = (1,0);
C = B/2;
D=C/2;
E = D/2;
F=E/2;
draw(A--B);
dot(A);
dot(B);
dot(C);
dot(D);
dot(E);
dot(F);
label("$A$",A,S);
label("$B$",B,S);
label("$C$",C,S);
label("$D$",D,S);
label("$E$",E,S);
label("$F$",F,S);
[/asy]

The positive factors of $12$ are $1, 2, 3, 4, 6,$ and $12$. The negative factors of $12$ are $-1, -2, -3, -4, -6,$ and $-12$. When we add these twelve numbers together, we can pair each positive factor with its negation: \begin{align*}
[1+(-1)] + [2 + (-2)] + [3 + (-3)]& + [4 + (-4)] \\
{}+ [6 + (-6)] + [12 + (-12)] &= 0 + 0 + 0 + 0 + 0 + 0 \\
&= \boxed{0}.
\end{align*}

